import React from "react";
import '../CSS/Country.css';
import { NavLink } from "react-router-dom";



const Country = (props) =>{
    const onClick = () => {
        console.log(props.reference);
    }

    console.log(props.reference);
    return(
        <div>
            <div className="Country">
                <path data-title={props.title} d={props.d}/>
                <area onClick={(e) => this.onClick(e)}></area>
                <area d={props.d} href={props.reference}></area>
            </div>
        </div>
    )
}

export default Country;
